tables.table_schema:
CREATE TABLE website_navigation_patterns (
  user_id INT,
  timestamp TIMESTAMP,
  page_visited VARCHAR
);

CREATE TABLE user_navigation_patterns (
    user_id INT,
    page_visited VARCHAR,
    timestamp TIMESTAMP
);

CREATE TABLE navigation_events (
    event_id INT,
    user_id INT,
    event_type VARCHAR,
    timestamp TIMESTAMP
);

CREATE TABLE user_navigation (
   user_id INT,
   page_visited VARCHAR(255),
   timestamp TIMESTAMP
);

CREATE TABLE page_details (
   page_id INT,
   page_title VARCHAR(255),
   page_url VARCHAR(255),
   unique_visitors INT
);

CREATE TABLE navigation_stats (
   navigation_id INT,
   user_id INT,
   navigation_duration INT,
   exit_page VARCHAR(255)
);

CREATE TABLE website_users (
    user_id INT PRIMARY KEY,
    username VARCHAR(50) NOT NULL,
    email VARCHAR(100) NOT NULL,
    registration_date TIMESTAMP
);

CREATE TABLE page_views (
    view_id INT PRIMARY KEY,
    user_id INT NOT NULL,
    page_url VARCHAR(255) NOT NULL,
    view_timestamp TIMESTAMP
);

CREATE TABLE navigation_events (
    event_id INT PRIMARY KEY,
    view_id INT NOT NULL,
    event_type VARCHAR(50) NOT NULL,
    event_timestamp TIMESTAMP
);

CREATE TABLE user_sessions (
    session_id INT PRIMARY KEY,
    user_id INT NOT NULL,
    start_timestamp TIMESTAMP,
    end_timestamp TIMESTAMP
);

CREATE TABLE click_events (
    click_id INT PRIMARY KEY,
    event_id INT NOT NULL,
    element_id INT NOT NULL,
    click_timestamp TIMESTAMP
);
